import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div className="row">
            <h2 className="col-xs-12">stephen hathaway is a product designer in denver, currently sr. experience designer at slalom.</h2>
          </div>
          <div className="row">
              <div className="col-xs-12
                          col-sm-8
                          col-md-6
                          col-lg-4">
                  <div className="box">Responsive</div>
              </div>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
